import { Text, View } from "react-native";

const NavigateButtonIcon = ({index}) =>{
    return(
        <View>
            {index===0 ?
            <Text>٩(˃̶͈̀௰˂̶͈́)و</Text> : <Text>๑ᵒᯅᵒ๑</Text>}
        </View>
    )
}

export default NavigateButtonIcon;
